this['JST']['app/templates/about.html'] = function(data) { return function (obj,_) {
var __p=[],print=function(){__p.push.apply(__p,arguments);};with(obj||{}){__p.push('<div class="background">\n  <div class="container">\n    \n    <div class="row">\n      <div class="span6 offset1">\n        <h1>ABOUT</h1>\n        <h2>What is 311 Labs?</h2>\n        <p>A space where your dreams of the possiblities of 311 data can become a reality! We\'re here to experiment and play, but most importantly our goal is to help inform citizens and cities along the way.</p>\n        <h2>What is 311?</h2>\n        <p>We\'re not referring to the band from the 90s, it\'s the number you call to report non-emergency service requests from your city. Examples of non-emergency service requests include: potholes, grafitti removal, street lights are out, tree trim, etc.</p>\n        <h2>The Scientists</h2>\n        <p><a href="http://codeforamerica.org" target="_blank">Code for America</a> helps governments work better for everyone with the people and the power of the web. Through our <a href="http://codeforamerica.org/fellows/" target="_blank">Fellowship</a>, <a href="http://codeforamerica.org/accelerator/" target="_blank">Accelerator</a>, and <a href="http://brigade.codeforamerica.org/" target="_blank">Brigade</a>, we\'re building a network of cities, citizens, community groups, and startups, all equally committed to reimagining government for the 21st century.</p>\n        <h2>In the News</h2>\n        <ul class="unstyled">\n          <li class="news">Code for America Blog - <a href="http://codeforamerica.org/2012/07/12/hello-311-labs/" target="_blank">Hello 311 Labs</a></li>\n          <li class="news">Huffington Post - <a href="http://www.huffingtonpost.com/angel-kittiyachavalit/welcome-to-your-citys-cus_b_1680727.html?utm_hp_ref=dc&ir=DC" target="_blank">Welcome to [Your City\'s] Customer Service</a></li>\n        </ul>\n      </div>\n      <div class="span4 molecules hidden-phone">\n      </div>\n    </div>\n\n  </div>\n</div>\n\n<footer>\n  <div class="container">\n    <div class="row">\n      <div class="span6 emailsignup">\n        <form onSubmit="return false;">\n          <label>Civic experiments, delivered!</label>\n          <input type="email" id="emailAddress" class="input-text" required="required" name="emailAddress" placeholder="ENTER YOUR EMAIL">\n          <input type="submit" id="submit-email" class="small-button" value="JOIN">\n        </form>\n      </div>\n      <div class="span6">  \n        <ul class="unstyled">\n          <li><a href="/experiments">Experiments</a></li>\n          <li><a href="http://open311.org/" target="_blank">Open311</a></li>\n          <li><a href="/about">About</a></li>\n          <li><a href="/contact-us">Contact Us</a></li>\n        </ul>\n      </div>\n    </div>\n  </div>\n</footer>\n');}return __p.join('');
}(data, _)};

