this['JST']['app/templates/experiments.html'] = function(data) { return function (obj,_) {
var __p=[],print=function(){__p.push.apply(__p,arguments);};with(obj||{}){__p.push('<div class="background">\n  <div class="container">\n\n    <div class="row">\n\n      <div class="span3 offset1">\n        <h1>EXPERIMENTS</h1>\n        <h2>Check \'em out:</h2>\n        <ul class="unstyled experimentsnav">\n          <li class="selected" id="expnav-srtracker">311 Service Tracker<sup>NEW!</s></li>\n          <li id="expnav-dailybrief">The Daily Brief</li>\n          <li id="expnav-open311status">Open311 Status</li>\n          <li id="expnav-311dashboard">311 Dashboard</li>\n        </ul>\n      </div>\n\n      <div class="span6 screenshots">\n\n        <div class="experiments" id="experiment-srtracker">\n          <a href="http://servicetracker.cityofchicago.org/" target="_blank">\n            <img src="/assets/img/srtracker_screenshots.png" />\n          </a>\n          <a href="http://servicetracker.cityofchicago.org/" target="_blank"><h2>311 Service Tracker</h2></a>\n          <p class="screenshot-tagline">Track your 311 service request.</p>\n          <p class="screenshot-info">Ever wonder what happens once you submit your service request? No need to wonder anymore! Service Tracker allows citizens to track what is happening to their service request and even get updates straight to their inbox.</p>\n          <h3>Supported Browsers:</h3>\n          <ul class="unstyled browser_comp">\n            <li><a class="browser chrome" href="https://www.google.com/intl/en/chrome/browser/" alt="chrome" target="_blank"></a></li>\n            <li><a class="browser firefox" href="http://www.mozilla.org/en-US/firefox/new/" alt="firefox" target="_blank"></a></li>\n            <li><a class="browser opera" href="http://www.opera.com/download/" alt="opera" target="_blank"></a></li>\n            <li><a class="browser ie" href="http://windows.microsoft.com/en-US/internet-explorer/downloads/ie/" alt="internet explorer" target="_blank"></a></li>\n          </ul>\n          <ul class="unstyled">\n            <li>\n              <a class="github" href="https://github.com/codeforamerica/srtracker" target="_blank">Fork me on Github</a>\n            </li>\n            <li>\n              <a class="contact" href="/contact-us">Want this in your city? Contact us!</a>\n            </li>\n          </ul>\n        </div>   \n\n        <div class="experiments" id="experiment-dailybrief">\n          <img src="/assets/img/daily_brief_screenshot_large.jpg" />\n          <h2>The Daily Brief</h2>\n          <p class="screenshot-tagline">Snapshot of service requests in your city right now</p>\n          <p class="screenshot-info">Want to wake up and get a quick glance of what\'s happening in your city? This site is for you! Explore and filter 311 service requests by neighborhood, service name, and status. Recommended with a cup of coffee or tea in hand.</p>\n          <h3>Check out cities that are currently using it:</h3>\n          <ul class="unstyled cities">\n            <li><a href="http://dailybrief.311labs.org/boston" target="_blank">Boston, MA</a></li>\n            <li><a href="http://dailybrief.311labs.org/baltimore" target="_blank">Baltimore, MD</a></li>\n            <li><a href="http://dailybrief.311labs.org/bloomington" target="_blank">Bloomington, IN</a></li>\n          </ul>\n          <h3>Supported Browsers:</h3>\n          <ul class="unstyled browser_comp">\n            <li><a class="browser chrome" href="https://www.google.com/intl/en/chrome/browser/" alt="chrome" target="_blank"></a></li>\n            <li><a class="browser firefox" href="http://www.mozilla.org/en-US/firefox/new/" alt="firefox" target="_blank"></a></li>\n            <li><a class="browser opera" href="http://www.opera.com/download/" alt="opera" target="_blank"></a></li>\n            <li><a class="browser ie-cs" href="http://windows.microsoft.com/en-US/internet-explorer/downloads/ie/" alt="internet explorer" target="_blank"></a></li>\n          </ul>\n          <ul class="unstyled">\n            <li>\n              <a class="github" href="https://github.com/codeforamerica/311DailyBrief" target="_blank">Fork me on Github</a>\n            </li>\n            <li>\n              <a class="contact" href="/contact-us">Want this in your city? Contact us!</a>\n            </li>\n          </ul>\n        </div>\n\n        <div class="experiments" id="experiment-open311status">\n          <a href="http://open311status.herokuapp.com/" target="_blank">\n            <img src="/assets/img/open311_status_screenshot.png" />\n          </a>\n          <a href="http://open311status.herokuapp.com/" target="_blank"><h2>Open311 Status</h2></a>\n          <p class="screenshot-tagline">Nationwide Open311 real-time availability and performance.</p>\n          <p class="screenshot-info">This site shows if Open311 APIs are down or have performance issues, and provides Public APIs uptime, comprehensiveness and citizen utilization.</p>\n          <ul class="unstyled">\n            <li>\n              <a class="github" href="https://github.com/codeforamerica/open311status" target="_blank">Fork me on Github</a>\n            </li>\n            <li>\n              <a class="contact" href="/contact-us">Not tracking your city? Contact us!</a>\n            </li>\n          </ul>\n        </div>\n\n        <div class="experiments" id="experiment-srtracker">\n          <a href="http://servicetracker.cityofchicago.org/" target="_blank">\n            <img src="/assets/img/srtracker_screenshots.png" />\n          </a>\n          <a href="http://servicetracker.cityofchicago.org/" target="_blank"><h2>311 Service Tracker</h2></a>\n          <p class="screenshot-tagline">Track your 311 service request.</p>\n          <p class="screenshot-info">Ever wonder what happens once you submit your service request? No need to wonder anymore! Service Tracker allows citizens to track what is happening to their service request and even get updates straight to their inbox.</p>\n          <ul class="unstyled">\n            <li>\n              <a class="github" href="https://github.com/codeforamerica/srtracker" target="_blank">Fork me on Github</a>\n            </li>\n            <li>\n              <a class="contact" href="/contact-us">Want this in your city? Contact us!</a>\n            </li>\n          </ul>\n        </div>    \n\n        <div class="experiments" id="experiment-311dashboard">\n          <img src="/assets/img/311dashboard_screenshot.png" />\n          <h2>311 Dashboard</h2>\n          <p class="screenshot-tagline">Comprehensive view of 311 data in your city</p>\n          <p class="screenshot-info">Dive into your city\'s 311 data the way that is most comfortable to you! Whether it\'s points on a map, rows in a table, or through graphs and statistics, the 311 Dashboard will be the go-to place. So get your scuba gear ready!</p>\n          <a class="contact" href="/contact-us">Want this in your city? Contact us!</a> \n        </div>\n        \n      </div>\n\n    </div>\n\n  </div>\n</div>\n\n<footer>\n  <div class="container">\n    <div class="row">\n      <div class="span6 emailsignup">\n        <form onSubmit="return false;">\n          <label>Civic experiments, delivered!</label>\n          <input type="email" id="emailAddress" class="input-text" required="required" name="emailAddress" placeholder="ENTER YOUR EMAIL">\n          <input type="submit" id="submit-email" class="small-button" value="JOIN">\n        </form>\n      </div>\n      <div class="span6">  \n        <ul class="unstyled">\n          <li><a href="/experiments">Experiments</a></li>\n          <li><a href="http://open311.org/" target="_blank">Open311</a></li>\n          <li><a href="/about">About</a></li>\n          <li><a href="/contact-us">Contact Us</a></li>\n        </ul>\n      </div>\n    </div>\n  </div>\n');}return __p.join('');
}(data, _)};

